    false,nt"url": null,nt"notes": "Landslide potential is based on slope and
    lithology. Landslide is considered probable if the slope is 12 percent or greater
    and correlated with a formation known to contain shale, unconsolidated sediments
    or surficial materials greater than or equal to 20 feet in thickness; and if the
    slope is greater than 20 percent. Slope values are the same as those used by Hoffman
    (1995, 1997, 1999) is previous maps to determine landslide hazard and were based
    on field research in Jefferson County. This project was funded by Missouri State
